Live at the El Rey is the only currently existing concert DVD featuring comic singer-songwriter Stephen Lynch. It is a live recording of one of Lynch's concerts at the El Rey Theatre in Los Angeles during December 2003.
The special features include a commentary track featuring Lynch and his fellow performers, younger brother Drew Lynch and best friend Mark Teich. Also included are a clip from one of Lynch's earliest live performances (featuring &quot;Jim Henson's Dead&quot;), a clip of Lynch recording &quot;Lullaby&quot; in the studio for his first album, A Little Bit Special, and a short film recorded by Lynch's wife, Erin Dwight, called Lynch and Teich in Brooklyn.

